import React from 'react';
import GlobalCorona from './components/Global';
import { api } from './services/api';
import { helper } from './helpers/common';

export default class App extends React.Component {
	constructor(props) {
		super(props);
		this.state = {
			data: {},
			loading: false,
			error: {}
		};
	}

	async componentDidMount() {
		const result = await api.getDataVirusCorona;

		if (!helper.getPropsId(result)) {
			this.setState({ ...this.state, data: result, loading: false, error: {} });
		} else {
			this.setState({ ...this.state, data: {}, loading: false, error: { cod: 404 } });
		}
	}
	render() {
		console.log(this.state.data, this.state.loading);
		return (
			<>
				<GlobalCorona />
			</>
		);
	}
}
